import styled from 'styled-components';

const HomePage = styled.div`
    display:flex;
    flex-wrap:wrap;
    gap:17.4rem;
    justify-content:space-between;
    border:#00;
    `;

export const HomePageImage = styled.img`
    width:33.3%;
`;
export default HomePage;
